import React from "react";

function LookupResult() {
    return (
        <div>
            <table>
                <tr>
                    <th>Full Name</th>
                </tr>
                <tr>
                    <td>Customer's Name</td>
                </tr>
            </table>
        </div>
    )
}

export default LookupResult;
